s($,"bps","b3P",()=>A.b([A.a9("BGM",1,"\ud83c\udfb5 \uc74c\uc545/\ub178\ub798","\ud83d\udc26 \uc790\uc5f0/\uc18c\uc74c","\ud83d\udcfb \ub77c\ub514\uc624/\ud31f\uce90\uc2a4\ud2b8","\uc624\ub298 \ub0b4 \uadd3\uac00\uc5d0 \ub9f4\ub3c8 \uac83\uc740?","\uc624\ub298\uc758 \ub178\ub3d9\uc694 \ud639\uc740 \ucd94\ucc9c\uace1\uc740?","\uc5b4\ub5a4 \uc18c\ub9ac\uac00 \uac00\uc7a5 \uc778\uc0c1 \uae4a\uc5c8\ub098\uc694?","\uadc0\ub85c \ub4e3\ub294 \uc774\uc57c\uae30\uc5d0\uc11c \uc5b4\ub5a4 \uc7ac\ubbf8\ub97c \ucc3e\uc558\ub098\uc694?"),A.a9("\uc601\uc0c1",2,"\ud83c\udfac \uae34 \uc601\ud654/\ub4dc\ub77c\ub9c8","\ud83d\udcf1 \uc20f\ud3fc/\uc720\ud29c\ube0c","\ud83d\udcfa \uc608\ub2a5 \ud55c \ud3b8","\uc624\ub298 \ubcf8 \uc601\uc0c1 \ucf58\ud150\uce20\ub294?","\uc8fc\uc778\uacf5\uc5d0\uac8c \uac10\uc815\uc774\uc785\ud55c \uc7a5\uba74\uc740?","\ub3c4\ud30c\ubbfc\uc774 \ud130\uc9c0\ub294 \uc21c\uac04\uc774\uc5c8\ub098\uc694?","\uc544\ubb34 \uc0dd\uac01 \uc5c6\uc774 \uc6c3\uc744 \uc218 \uc788\uc5c8\ub098\uc694?"),A.a9("\ucde8\ubbf8",3,"\ud83c\udfa8 \uc990\uacbc\uc74c","\ud83d\udcbc \uc77c\ud558\ub290\ub77c \ubabb\ud568","\ud83d\udc40 \uc544\uc774\uc1fc\ud551/\uad6c\uacbd","\ub098\ub97c \uc704\ud55c \ucde8\ubbf8 \uc2dc\uac04\uc774 \uc788\uc5c8\ub098\uc694?","\ucde8\ubbf8\ub97c \uc990\uae38 \ub54c \uc2dc\uac04 \uac00\ub294 \uc904 \ubab0\ub790\ub098\uc694?","\uc8fc\ub9d0\uc5d0\ub77c\ub3c4 \uaf2d \ud558\uace0 \uc2f6\uc740 \ucde8\ubbf8\ub294?","\uad6c\uacbd\ud558\uba74\uc11c \ucc1c\ud574\ub454 \ubb3c\uac74\uc774\ub098 \uc704\uc2dc\ub9ac\uc2a4\ud2b8\ub294?"),A.a9("\uc624\ub298\uc758 \ub0b4\ud3b8",4,"\ud83c\udfa8 \uc608\uc220\uac00 \uce5c\uad6c","\ud83e\udd13 \ub355\ud6c4 \uce5c\uad6c",null,"\ucde8\ubbf8 \uc0dd\ud65c\uc744 \uacf5\uc720\ud558\uace0 \uc2f6\uc740 \uc0ac\ub78c\uc740?","","",null)],t.Y))
