s($,"bqj","b4u",()=>A.b([A.a9("\uc721\uc544\ub09c\uc774\ub3c4",1,"\ud83d\ude08 \ub9e4\uc6b4\ub9db","\ud83d\udc7c \uc21c\ud55c\ub9db","\ud83d\ude10 \ud3c9\ud0c0(So-so)","\uc624\ub298 \uc721\uc544 \ub09c\uc774\ub3c4\ub294 \uc5b4\ub560\ub098\uc694?","\uac00\uc7a5 \ud798\ub4e4\uac8c \ud588\ub358 \uc21c\uac04\uc740 \uc5b8\uc81c\uc778\uac00\uc694?","\uc544\uc774\uac00 \uc608\ubed0 \ubcf4\uc600\ub358 \uacb0\uc815\uc801 \uc21c\uac04\uc740?","\ud2b9\ubcc4\ud55c \uc0ac\uac74 \uc0ac\uace0 \uc5c6\uc774 \ubb34\ub09c\ud558\uac8c \uc9c0\ub098\uac14\ub098\uc694?"),A.a9("\ub0b4 \uccb4\ub825",2,"\ud83e\udddf\u200d\u2642\ufe0f \uc880\ube44 \ubaa8\ub4dc","\ud83d\udcaa \uc288\ud37c\ub9e8/\uc6b0\uba3c","\ud83d\udeb6 \uac04\uc2e0\ud788 \ubc84\ud300","\ub098\uc758 \ud604\uc7ac \uccb4\ub825 \uc0c1\ud0dc\ub294?","\uc9c0\uae08 \ub2f9\uc7a5 \uc218\ud608\uc774 \ud544\uc694\ud55c \uac83\uc740? (\ucee4\ud53c/\uc7a0 \ub4f1)","\ub0a8\uc740 \uccb4\ub825\uc73c\ub85c \uc544\uc774\uc640 \ubb34\uc5c7\uc744 \ub354 \ud558\uace0 \uc2f6\ub098\uc694?","\uc721\uc544 \ub9c8\ub77c\ud1a4\uc744 \uc644\uc8fc\ud558\uac8c \ud574 \uc900 \uc6d0\ub3d9\ub825\uc740?"),A.a9("\uc544\uc774 \uae30\ubd84",3,"\u2601\ufe0f \ud750\ub9bc/\ub5bc\uc7c1\uc774","\u2600\ufe0f \ub9d1\uc74c/\ucc9c\uc0ac","\ud83c\udf2c\ufe0f \uc624\ub77d\uac00\ub77d \ubc14\ub78c","\uc624\ub298 \uc544\uc774\uc758 \ud150\uc158\uc740?","\ubb34\uc5c7\uc774 \uc544\uc774\ub97c \uc18d\uc0c1\ud558\uac8c \ub9cc\ub4e4\uc5c8\ub098\uc694?","\uc544\uc774\ub97c \uae4c\ub974\ub974 \uc6c3\uac8c \ub9cc\ub4e0 \ud589\ub3d9\uc740?","\ud558\ub8e8\uc5d0\ub3c4 \uc5f4\ub450 \ubc88 \ubc14\ub00c\ub294 \uc544\uc774 \ub9c8\uc74c, \uc5b4\ub5bb\uac8c \ub9de\ucdc4\ub098\uc694?"),A.a9("\uc624\ub298\uc758 \ub0b4 \ud3b8",4,"\ud83d\udc75 \uc721\uc544 \ub9cc\ub819 \ud560\uba38\ub2c8","\ud83d\udc69\u200d\u2695\ufe0f \uc721\uc544 \uba58\ud1a0 \ubc15\uc0ac\ub2d8",null,"\uc624\ub298 \ub204\uad6c\uc758 \uc704\ub85c\uac00 \ud544\uc694\ud55c\uac00\uc694?","","",null)],t.Y))
s($,"bqk","b4v",()=>A.b([A.a9("\uc2dd\uc0ac \uc804\uc7c1",1,"\ud83c\udf5a \ud3c9\ud654\ub85c\uc6b4 \uba39\ubc29","\ud83e\udd44 \ubc25\uadf8\ub987 \uc804\uc7c1","\ud83c\udf6a \uac04\uc2dd\uc73c\ub85c \ud241","\uc624\ub298 \ubc25 \uba39\uc774\uae30\ub294 \uc5b4\ub560\ub098\uc694?","\uc544\uc774\uac00 \uac00\uc7a5 \uc798 \uba39\uc740 \ubc18\ucc2c\uc740?","\uc548 \uba39\uaca0\ub2e4\uace0 \ud22c\uc815 \ubd80\ub9b4 \ub54c \uc5b4\ub5bb\uac8c \ub300\ucc98\ud588\ub098\uc694?","\ubc25 \ub300\uc2e0 \ubb34\uc5c7\uc73c\ub85c \ubc30\ub97c \ucc44\uc6e0\ub098\uc694?"),A.a9("\uc218\uba74/\ub0ae\uc7a0",2,"\ud83c\udf19 \uae30\uc808 \uc721\ud1f4","\ud83d\udc40 \ub124\ubc84\uc5d4\ub529","\ud83e\uddf8 \ub4b9\uad74\ub4b9\uad74","\uc544\uc774 \uc7ac\uc6b0\uae30(\uc721\ud1f4) \uc131\uacf5\ud588\ub098\uc694?","\uc721\ud1f4 \ud6c4 \uc790\uc720\uc2dc\uac04\uc5d0 \ubb34\uc5c7\uc744 \ud558\uc2e4 \uac74\uac00\uc694?","\uc548 \uc790\ub294 \uc544\uc774\uc640 \ubc24\ub2a6\uac8c\uae4c\uc9c0 \ubb58 \ud588\ub098\uc694?","\uc7a0\ub4e4\uae30 \uc804 \uc544\uc774\uc640 \ub3c4\ub780\ub3c4\ub780 \ubb34\uc2a8 \uc598\uae30\ub97c \ub098\ub234\ub098\uc694?"),A.a9("\ubaa9\uc695",3,"\ud83d\udec1 \ucca8\ubc99\ucca8\ubc99 \ubb3c\ub180\uc774","\ud83d\udebf \uc53b\uae30 \uc2eb\uc5b4 \uc804\uc7c1","\ud83e\uddd6 \ubb3c\uc218\uac74 \uc4f1\uc2f9","\uc624\ub298 \uc53b\uae30\ub294 \uc2dc\uac04\uc740 \uc5b4\ub560\ub098\uc694?","\uc544\uc774\uac00 \ubb3c\uc18d\uc5d0\uc11c \ubb34\uc5c7\uc744 \ud558\uba70 \uc990\uac70\uc6cc\ud588\ub098\uc694?","\uc5b4\ub5a4 \uc810 \ub54c\ubb38\uc5d0 \uc53b\uae30\ub294 \uac8c \ud798\ub4e4\uc5c8\ub098\uc694?","\uac04\ub2e8\ud558\uac8c \uc53b\uae30\uace0 \ub098\ub2c8 \ub9c8\uc74c\uc774 \ud3b8\ud55c\uac00\uc694?"),A.a9("\uc624\ub298\uc758 \ub0b4 \ud3b8",4,"\u2615 \uc606\uc9d1 \uc721\uc544 \ub3d9\uc9c0","\ud83d\udcda \uc544\ub3d9 \uc2ec\ub9ac \uc804\ubb38\uac00",null,"\uc721\uc544 \uace0\ubbfc\uc744 \ub098\ub20c \uc0c1\ub300\ub294?","","",null)],t.Y))
s($,"bql","b4w",()=>A.b([A.a9("\ub180\uc774",1,"\ud83e\udd3e \ubab8\uc73c\ub85c \ub180\uae30","\ud83e\udde9 \uc549\uc544\uc11c \ub180\uae30","\ud83d\udcda \ucc45 \uc77d\uc5b4\uc8fc\uae30","\uc544\uc774\uc640 \uc5b4\ub5bb\uac8c \ub180\uc544\uc92c\ub098\uc694?","\uc544\uc774\ubcf4\ub2e4 \ub0b4\uac00 \ub354 \uc9c0\uce58\uc9c4 \uc54a\uc558\ub098\uc694?","\uc544\uc774\uc758 \uc9d1\uc911\ub825\uc774 \ub3cb\ubcf4\uc778 \ub180\uc774\ub294?","\uc544\uc774\uac00 \uac00\uc7a5 \uc88b\uc544\ud588\ub358 \uc774\uc57c\uae30\ub294 \ubb34\uc5c7\uc778\uac00\uc694?"),A.a9("\uc678\ucd9c",2,"\ud83c\udfe0 \uc9d1\ucf55\uc774 \ucd5c\uace0","\ud83c\udf33 \ubc16\uc73c\ub85c \ud0c8\ucd9c","\ud83d\udef4 \ub3d9\ub124 \ud55c \ubc14\ud034","\uc624\ub298 \ubc14\uae65\ubc14\ub78c \uc880 \uc42c\uc5c8\ub098\uc694?","\uc9d1\uc5d0\uc11c \uc544\uc774\uc640 \uc5b4\ub5bb\uac8c \uc2dc\uac04\uc744 \ub54c\uc6e0\ub098\uc694?","\ub098\uac00\uc11c \uacaa\uc740 \ud2b9\ubcc4\ud55c \uc5d0\ud53c\uc18c\ub4dc\uac00 \uc788\ub098\uc694?","\uc9d1 \uadfc\ucc98\uc5d0\uc11c \ubc1c\uacac\ud55c \uc0c8\ub85c\uc6b4 \uc990\uac70\uc6c0\uc740?"),A.a9("\ud6c8\uc721",3,"\ud83d\ude45 \ub2e8\ud638\ubc15 \ubaa8\ub4dc","\ud83d\ude46 \ubb3c\ub801 \ubcf5\uc22d\uc544","\ud83d\udde3\ufe0f \ucc28\ubd84\ud55c \uc124\uba85","\uc624\ub298 \ud6c8\uc721 \ud0dc\ub3c4\ub294 \uc5b4\ub560\ub098\uc694?","\ub2e8\ud638\ud558\uac8c \ub9d0\ud558\uace0 \ub098\uc11c \ub9c8\uc74c\uc774 \uc4f0\uc600\ub098\uc694?","\uc544\uc774\uc758 \uc694\uad6c\ub97c \ub2e4 \ub4e4\uc5b4\uc8fc\ub2c8 \ubab8\uc774 \ud798\ub4e4\uc9c4 \uc54a\uc558\ub098\uc694?","\uc544\uc774 \ub208\ub192\uc774\uc5d0 \ub9de\ucdb0 \uc124\uba85\ud574\uc8fc\ub2c8 \uc798 \uc54c\uc544\ub4e3\ub358\uac00\uc694?"),A.a9("\uc624\ub298\uc758 \ub0b4 \ud3b8",4,"\ud83e\uddd8 \uc790\uc560\ub85c\uc6b4 \uc131\uc9c1\uc790","\ud83c\udf7a \ucfe8\ud55c \uc778\uc0dd \uc120\ubc30",null,"\ud6c8\uc721 \ud6c4\uc5d0 \ub4dc\ub294 \uc8c4\ucc45\uac10\uc740 \ub204\uac00 \ub2ec\ub798\uc904\uae4c\uc694?","","",null)],t.Y))
s($,"bqm","b4x",()=>A.b([A.a9("\uc778\ub0b4\uc2ec",1,"\ud83e\udd2f \ub69c\uaed1 \uc5f4\ub9bc","\ud83d\ude4f \uc0ac\ub9ac \ub098\uc634","\ud83d\udd22 \uc22b\uc790 \uc138\uae30","\uc624\ub298 \ub098\uc758 \uc778\ub0b4\uc2ec \uc218\uce58\ub294?","\ud3ed\ubc1c\ud588\ub358 \uc21c\uac04, \uc0ac\uc2e4\uc740 \uc5b4\ub5bb\uac8c \ub9d0\ud558\uace0 \uc2f6\uc5c8\ub098\uc694?","\uc6b1\ud558\ub294 \ub9c8\uc74c\uc744 \uc5b4\ub5bb\uac8c \uafb9 \ub20c\ub800\ub098\uc694?","\uc18d\uc73c\ub85c \uc14b\uc744 \uc138\uba74\uc11c \ud654\ub97c \uac00\ub77c\uc549\ud614\ub098\uc694?"),A.a9("\uac10\ub3d9",2,"\ud83d\ude2d \ubb49\ud074\ud588\uc5b4","\ud83d\ude10 \ud3c9\ubc94\ud588\uc5b4","\ud83d\ude0d \uadc0\uc5ec\uc6b4 \uc2e4\uc218","\uc624\ub298 \uc544\uc774\uc5d0\uac8c \uac10\ub3d9\ubc1b\uc558\ub098\uc694?","\ub098\ub97c \uc6b8\ucee5\ud558\uac8c \ub9cc\ub4e0 \uc544\uc774\uc758 \ub9d0\uc774\ub098 \ud589\ub3d9\uc740?","\uadf8\ub798\ub3c4 \uc544\uc774\uac00 \uc788\uc5b4 \ub2e4\ud589\uc774\ub77c\uace0 \ub290\ub080 \uc21c\uac04\uc740?","\uc2e4\uc218\ub9c8\uc800 \uc0ac\ub791\uc2a4\ub7ec\uc6e0\ub358 \uc21c\uac04\uc740 \uc5b8\uc81c\uc778\uac00\uc694?"),A.a9("\uc560\uc815\ud45c\ud604",3,"\ud83d\ude18 \ubf40\ubf40 \ubc31\ub9cc\ubc88","\ud83d\ude36 \ub9c8\uc74c\uc73c\ub85c\ub9cc","\u270b \ud558\uc774\ud30c\uc774\ube0c","\uc0ac\ub791\ud55c\ub2e4\uace0 \ub9ce\uc774 \ub9d0\ud574\uc92c\ub098\uc694?","\uc544\uc774\ub294 \uc5c4\ub9c8/\uc544\ube60\uc5d0\uac8c \uc5b4\ub5bb\uac8c \uc0ac\ub791\uc744 \ud45c\ud604\ud588\ub098\uc694?","\ub0b4\uc77c \uc544\uce68\uc5d4 \ub208 \ub728\uc790\ub9c8\uc790 \uc548\uc544\uc8fc\ub294 \uac70 \uc5b4\ub54c\uc694?","\uc2a4\ud0a8\uc2ed\uc744 \ud558\uba70 \ub290\ub080 \uc544\uc774\uc758 \uc628\uae30\ub294 \uc5b4\ub560\ub098\uc694?"),A.a9("\uc624\ub298\uc758 \ub0b4 \ud3b8",4,"\ud83d\udc8c \uac10\uc131 \uc2dc\uc778","\ud83e\uddf8 \ud3ec\uadfc\ud55c \uacf0\uc778\ud615",null,"\uc9c0\uce5c \ub9c8\uc74c\uc744 \uc5b4\ub8e8\ub9cc\uc838 \uc904 \uc0ac\ub78c\uc740?","","",null)],t.Y))
